import { BrowserRouter, Switch, Route, Link } from 'react-router-dom'
function App() {
  return (
    <BrowserRouter>
      <Link to='/'>Home</Link>
      <Link to='/about'>About</Link>
      <Switch>
        <Route exact path='/' render={()=>{<h1>Home page</h1>}}/>
        <Route exact path='/about' render={()=>{<h1>About Page page</h1>}}/>
      </Switch>
    </BrowserRouter>
  );
}

export default App;
